// AddProductPage.js
import React from 'react';
import Header from "../component/Header";
import Footer from "../component/Footer";
import AddProduct from "../component/AddProduct";

function AddProductPage() {
  return (
    <>
      <Header />
      <AddProduct />
      <Footer />
    </>
  );
}

export default AddProductPage;
